import { Box, Text, Link, StyledOcticon } from '@primer/react'
import {
    MarkGithubIcon,
    CheckIcon,
    CommentIcon,
    MortarBoardIcon,
} from '@primer/octicons-react'

const Notifications = (props) => {
    return(
        <Box m={8} border="1px solid" borderRadius={2} borderColor="border.muted" maxWidth={"500px"}>
            <Box display="flex" p={3} borderBottom="1px solid" borderColor="border.muted">
                <Box mr={2}>
                    <MarkGithubIcon size={24} />
                </Box>
                <h4>Notifications</h4>
            </Box>
        </Box>
    )
}

export default Notifications;
